void ChangeRegion() {
	static std::string* ForceRelayClusterValue = *(std::string**)(g_Memory->findPattern("steamnetworkingsockets.dll", "B8 ? ? ? ? B9 ? ? ? ? 0F 43") + 1);

	*ForceRelayClusterValue = DatacentersList[config->get_int("miscRegionChanger")];
}


